import { Dialog,Box,Typography,List,ListItem } from "@mui/material";

const dialogStyle={

    height:'96%',
    marginTop:'12%',
    width:'60%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'none'

}

const LoginDialog = () => {

    return (
        <Dialog 
        open={true}
        PaperProps={{sx: dialogStyle}}
        >
            <Box>
                <Box>
                    <Typography>To use the WhatsApp Mini on your Computer</Typography>
                    <List>
                        <ListItem>1. Open WhatsApp Mini on your phone</ListItem>
                        <ListItem>2. Tap Menu settings</ListItem>
                    </List>


                </Box>

                <Box>

                </Box>
            </Box>
        </Dialog>
    )
}

export default LoginDialog;
